# FUNCTION ifcconstraintsparambspline #
####################
def ifcconstraintsparambspline(degree, upknots, upcp, knotmult, knots, ):
    '''
	:param degree
	:type degree:Integer
	:param upknots
	:type upknots:Integer
	:param upcp
	:type upcp:Integer
	:param knotmult
	:type knotmult:(null)
	:param knots
	:type knots:(null)
	'''
    sum = knotmult[1]
    for i in range(2, upknots, 1):
        sum = sum + knotmult[i]
    if ((((degree < 1) or (upknots < 2)) or (upcp < degree)) or (sum != ((degree + upcp) + 2))):
        result = FALSE
        return result
    k = knotmult[1]
    if ((k < 1) or (k > (degree + 1))):
        result = FALSE
        return result
    for i in range(2, upknots, 1):
        if ((knotmult[i] < 1) or (knots[i] <= knots[i - 1])):
            result = FALSE
            return result
        k = knotmult[i]
        if ((i < upknots) and (k > degree)):
            result = FALSE
            return result
        if ((i == upknots) and (k > (degree + 1))):
            result = FALSE
            return result
    return result


